import { Route } from "react-router-dom";
import Landing from "./views/Landing/Landing";
import Home from "./views/Home/Home";


function App() {
  return (
    <div className="App">

      <Route exact path="/">
        <Landing />
      </Route>

      <Route path="/home">
        <Home/>
      </Route>

      <Route path="/form">
        <Form/>
      </Route>
    </div>
  );
}

export default App;
